ritical assets to improve loading speed.'=>'중요한 자산을 미리 로드하여 로딩 속도를 개선하십시오.','Preload key requests / assets'=>'주요 요청/자산 미리 로드','Preload key requests is a premium feature.'=>'사전 로드 키 요청은 프리미엄 기능입니다.','Preload key requests'=>'사전 로드 키 요청','Thank you so much!'=>'매우 감사합니다!','The constant %s is set to true, so no JavaScript or CSS file will be minified.'=>'상수 %s가 true로 설정되어 있으므로 JavaScript 또는 CSS 파일이 축소되지 않습니다.','Your WordPress install does not use a database prefix, so WP-Optimize was not able to differentiate which tables belong to WordPress so all tables are listed below.'=>'워드프레스 설치는 데이터베이스 접두사를 사용하지 않으므로 WP-옵티마이즈는 워드프레스에 속한 테이블을 구분할 수 없으므로 모든 테이블이 아래에 나열됩니다.','(%d files)'=>'(%d개 파일)','(This feature requires %s)'=>'(이 기능에는 %s가 필요합니다)','(with warnings - open the browser console for more details)'=>'(경고 있음 - 자세한 내용은 브라우저 콘솔을 여십시오)','Add "display=swap" to Google Fonts requests'=>'구글 폰트 요청에 "display=swap" 추가','Cache size:'=>'캐시 크기:','Cloudflare settings'=>'Cloudflare 설정','Enable the caching menu in the admin bar'=>'관리 표시줄에서 캐싱 메뉴 활성화','No such command found'=>'해당 명령을 찾을 수 없습니다.','No tweak provided'=>'조정이 제공되지 않음','Optimized table:'=>'최적화된 테이블:','Purge cache for all pages'=>'모든 페이지의 캐시 제거','Purge cache for this page'=>'이 페이지의 캐시 제거','Refresh the page to see the list'=>'목록을 보려면 페이지를 새로고침하세요.','Requires a page refresh after saving the settings.'=>'설정을 저장한 후 페이지 새로 고침이 필요합니다.','The command %s failed'=>'%s 명령이 실패했습니다.','This feature of Google Fonts is encouraged for better accessibility, but may result in a visible font change.'=>'구글 글꼴의 이 기능은 더 나은 접근성을 위해 권장되지만 글꼴이 눈에 띄게 변경될 수 있습니다.','This option will add a caching menu on the top admin bar.'=>'이 옵션은 상단 관리 표시줄에 캐싱 메뉴를 추가합니다.','This page has a fatal error'=>'이 페이지에는 치명적인 오류가 있습니다.','Tick the checkbox to merge / minify the corresponding file anyways.'=>'어쨌든 해당 파일을 병합/축소하려면 확인란을 선택하십시오.','We don\'t cache RSS feeds'=>'RSS 피드를 캐시하지 않습니다.','You do not have permission to purge the cache'=>'캐시를 제거할 권한이 없습니다.','Your website seems to use Cloudflare, which handles the browser caching rules.'=>'귀하의 웹사이트는 브라우저 캐싱 규칙을 처리하는 Cloudflare를 사용하는 것 같습니다.','Purge Cloudflare cached pages when the WP-Optimize cache is purged'=>'WP-옵티마이즈 캐시가 삭제될 때 Cloudflare 캐시 페이지 삭제','This option will add a link labeled "WP-Optimize" in the top admin bar, for easy access to the different features.'=>'이 옵션은 다양한 기능에 쉽게 액세스할 수 있도록 상단 관리 표시줄에 "WP-옵티마이즈"라는 레이블이 붙은 링크를 추가합니다.','Minify cache'=>'캐시 최소화','(Note that as jQuery is a common dependency, it probably needs to be loaded synchronously).'=>'(jQuery는 공통 종속성이므로 동기식으로 로드해야 할 수도 있습니다.)','All the compressed images for the site %s were successfully restored.'=>'사이트 %s의 모든 압축 이미지가 성공적으로 복원되었습니다.','Defer all the JavaScript files'=>'모든 JavaScript 파일 연기','Defer JavaScript'=>'자바스크립트 연기','Defer method:'=>'연기 방법:','Defer using JavaScript'=>'JavaScript를 사용하여 연기','Disable this setting if you have an error \'jQuery undefined\'.'=>'\'jQuery가 정의되지 않음\' 오류가 있는 경우 이 설정을 비활성화합니다.','Do you really want to restore all the compressed images?'=>'압축된 이미지를 모두 복원하시겠습니까?','Note: This image is already compressed by another plugin'=>'참고: 이 이미지는 이미 다른 플러그인으로 압축되어 있습니다.','Please check the browser console for any eventual JavaScript errors caused by deferring the scripts.'=>'스크립트 연기로 인해 발생하는 최종 JavaScript 오류에 대해서는 브라우저 콘솔을 확인하십시오.','Restore all compressed images'=>'모든 압축된 이미지 복원','Some themes and plugins need render blocking scripts to work.'=>'일부 테마 및 플러그인이 작동하려면 렌더링 차단 스크립트가 필요합니다.','Supported by all modern browsers.'=>'모든 최신 브라우저에서 지원됩니다.','The files in the list will be loaded asynchronously, and will not be minified or merged.'=>'목록의 파일은 비동기식으로 로드되며 축소되거나 병합되지 않습니다.','The UpdraftPlus Plugin Collection Sale'=>'UpdraftPlus 플러그인 컬렉션 판매','Use the "defer" html attribute'=>'"defer" html 속성 사용','Defer jQuery'=>'JQuery 연기','All files - including the ones processed by WP-Optimize - will be deferred, except the ones in the exclusion list above.'=>'WP-옵티마이즈에서 처리한 파일을 포함한 모든 파일은 위의 제외 목록에 있는 파일을 제외하고 연기됩니다.','The file was compressed from %s to %s, saving %s percent, using WP-Optimize'=>'WP-옵티마이즈를 사용하여 파일이 %s에서 %s로 압축되어 %s퍼센트를 절약했습니다.','Page caching was disabled, but with some warnings:'=>'페이지 캐싱이 비활성화되었지만 몇 가지 경고가 있습니다.','Page caching was enabled, but with some warnings:'=>'페이지 캐싱이 활성화되었지만 몇 가지 경고가 있습니다.','Preloading posts found in sitemap:'=>'사이트맵에 있는 게시물을 사전 로드 중:','Probably page cache preload is running already.'=>'페이지 캐시 사전 로드가 이미 실행 중일 수 있습니다.','The cache configuration file could not be saved to the disk; please check the file/folder permissions of %s .'=>'캐시 구성 파일을 디스크에 저장할 수 없습니다. %s의 파일/폴더 권한을 확인하십시오.','Unable to write inside the cache configuration folder (%s); please check file/folder permissions'=>'캐시 구성 폴더(%s)에 쓸 수 없습니다. 파일/폴더 권한을 확인하십시오','Unable to write inside the cache files folder (%s); please check file/folder permissions (no cache files will be able to be created otherwise)'=>'캐시 파일 폴더(%s)에 쓸 수 없습니다. 파일/폴더 권한을 확인하십시오(그렇지 않으면 캐시 파일을 생성할 수 없습니다).','Unable to write to or find wp-config.php; please check file/folder permissions.'=>'Wp-config.php에 쓰거나 찾을 수 없습니다. 파일/폴더 권한을 확인하십시오.','Unable to write the file advanced-cache.php inside the wp-content folder; please check file/folder permissions'=>'Wp-content 폴더 안에 advanced-cache.php 파일을 쓸 수 없습니다. 파일/폴더 권한을 확인하십시오','Please try to disable and then re-enable the WP-Optimize cache manually.'=>'수동으로 WP-옵티마이즈 캐시를 비활성화했다가 다시 활성화하십시오.','(enable if trying to isolate a JavaScript error introduced by minifying or merging)'=>'(축소 또는 병합으로 인해 발생하는 JavaScript 오류를 격리하려는 경우 활성화)','Are you sure?'=>'확실합니까?','Contain each included file in its own block'=>'포함된 각 파일을 자체 블록에 포함','CSS'=>'CSS','Current cache:'=>'현재 캐시:','Currently: %s'=>'현재: %s','Delete all the files generated by minifcation'=>'축소 기능으로 생성된 모든 파일 삭제','Disabled'=>'허용하지 않음','Do not load Google Fonts'=>'구글 글꼴을 로드하지 않음','Enable merging of CSS files'=>'CSS 파일 병합 활성화','Enable merging of JavaScript files'=>'JavaScript 파일 병합 활성화','Enabling the debug mode will add various comments and show more information in the files list.'=>'디버그 모드를 활성화하면 다양한 주석이 추가되고 파일 목록에 더 많은 정보가 표시됩니다.','Exclude posts and pages from the cache, straight from the post edit screen.'=>'게시물 편집 화면에서 바로 캐시에서 게시물과 페이지를 제외합니다.','Fonts'=>'글꼴','I confirm that I have understood the risks in doing that, and that I know what I am doing.'=>'나는 그렇게 하는 데 따르는 위험을 이해했으며 내가 무엇을 하고 있는지 알고 있음을 확인합니다.','I confirm that I will be able to revert the changes if needed.'=>'필요한 경우 변경 사항을 되돌릴 수 있음을 확인합니다.','If enabled, stylesheets from Google Fonts will not be loaded on the site and system fallback fonts will be used instead.'=>'사용하도록 설정하면 구글 글꼴의 스타일시트가 사이트에 로드되지 않고 대신 시스템 대체 글꼴이 사용됩니다.','If none of the plugins listed were ever installed on this website, you should not delete this table as it is likely to be used by an unlisted plugin.'=>'목록에 있는 플러그인이 이 웹사이트에 설치된 적이 없다면 목록에 없는 플러그인에서 사용될 가능성이 있으므로 이 표를 삭제하면 안 됩니다.','If some functionality is breaking on the frontend, disabling merging of JavaScript might fix the issues.'=>'프런트엔드에서 일부 기능이 중단되는 경우 JavaScript 병합을 비활성화하면 문제가 해결될 수 있습니다.','If some of the design is breaking on the frontend, disabling merging of CSS might fix the issues.'=>'일부 디자인이 프런트엔드에서 깨지는 경우 CSS 병합을 비활성화하면 문제가 해결될 수 있습니다.','If this is turned on, then the default settings are that JavaScript and CSS on this website will be concatenated and minified and HTML will be minified.'=>'이 기능이 켜져 있으면 이 웹 사이트의 JavaScript와 CSS가 연결되고 축소되고 HTML이 축소되는 것이 기본 설정입니다.','Inherit from the CSS settings'=>'CSS 설정에서 상속','It also adds extra actions in the status tab.'=>'또한 상태 탭에 추가 작업을 추가합니다.','JavaScript'=>'자바스크립트','Known plugins that use this table name:'=>'이 테이블 이름을 사용하는 알려진 플러그인:','List of excluded files used for IE compatibility.'=>'IE 호환성을 위해 사용되는 제외 파일 목록입니다.','List of files that can\'t or shouldn\'t be minified or merged.'=>'축소하거나 병합할 수 없거나 병합해서는 안 되는 파일 목록입니다.','More caching options'=>'더 많은 캐싱 옵션','No automatic backup was detected.'=>'자동 백업이 감지되지 않았습니다.','Not sure how to use the Minify feature?'=>'축소 기능을 사용하는 방법을 잘 모르시겠습니까?','Process CSS files'=>'CSS 파일 처리','Process JavaScript files'=>'JavaScript 파일 처리','Read more about what this does in our FAQs.'=>'FAQ에서 이것이 무엇을 하는지 자세히 알아보세요.','Remove the table'=>'테이블 제거','Same as home URL'=>'홈 URL과 동일','The new minified files will be regenerated when visiting your website\'s pages.'=>'축소된 새로운 파일은 웹사이트 페이지를 방문할 때 재생성됩니다.','The page caching could not be disabled: the WP_CACHE constant could not be removed from wp-config.php and the request to the filesystem to remove or empty advanced-cache.php failed.'=>'페이지 캐싱을 비활성화할 수 없습니다. wp-config.php에서 WP_CACHE 상수를 제거할 수 없고 파일 시스템에 대한 고급 캐시 제거 또는 비우기 요청이 실패했습니다.','The request to the filesystem to remove or empty advanced-cache.php failed'=>'파일 시스템에 대한 advanced-cache.php 제거 또는 비우기 요청이 실패했습니다.','The stylesheets will be merged or inlined.'=>'스타일시트가 병합되거나 인라인됩니다.','There are no processed files yet.'=>'아직 처리된 파일이 없습니다.','This highly requested feature adds an extra layer of optimization to your website, lowering the number of requests sent to your server by combining and minifying the JavaScript and CSS files.'=>'많이 요청된 이 기능은 웹 사이트에 추가 최적화 계층을 추가하여 JavaScript 및 CSS 파일을 결합하고 축소하여 서버로 전송되는 요청 수를 줄입니다.','This includes the older, non-expired cache, as well as the temporary files used to generate the minified files.'=>'여기에는 만료되지 않은 이전 캐시와 축소된 파일을 생성하는 데 사용되는 임시 파일이 포함됩니다.','This will reset the files generated by minify, but use the existing minify temporary files.'=>'이것은 축소에 의해 생성된 파일을 재설정하지만 기존 축소 임시 파일을 사용합니다.','Total cache:'=>'총 캐시:','Uses your site\'s default protocol.'=>'사이트의 기본 프로토콜을 사용합니다.','View the files'=>'파일 보기','Wipe settings'=>'초기화 설정','You are about to remove the table %s.'=>'%s 테이블을 제거하려고 합니다.','You can adjust the settings in the tabs above to control this to meet your requirements.'=>'위의 탭에서 설정을 조정하여 요구 사항에 맞게 제어할 수 있습니다.','Could not turn off the WP_CACHE constant in wp-config.php'=>'Wp-config.php에서 WP_CACHE 상수를 끌 수 없습니다.','%s will be replaced by a link tagRead more about this feature %son our website%s.'=>'이 기능에 대한 자세한 내용은 %s 당사 웹사이트%s를 참조하십시오.','%s will be replaced by a "strong" tagThis new version includes a new major feature: the ability to %s minify your scripts and stylesheets.%s'=>'이 새 버전에는 스크립트와 스타일시트를 %s 축소하는 기능이 포함되어 있습니다.%s','%s will be replaced by a "strong" tagWe also recently added the ability to %scombine and minify%s CSS, JavaScript and HTML, for an increased performance boost.'=>'또한 최근 성능 향상을 위해 CSS, JavaScript 및 HTML을 %s 결합 및 축소%s하는 기능을 추가했습니다.','WP-Optimize settings have been deleted successfully.'=>'WP-옵티마이즈 설정이 성공적으로 삭제되었습니다.','Advanced'=>'고급','Minify'=>'최소화','Minify status'=>'최소화 상태','Minify video preview'=>'비디오 미리보기 최소화','Go to minify settings.'=>'최소화 설정으로 이동합니다.','Reset the minified files'=>'최소화 파일 재설정','How to use the minify feature'=>'최소화 기능을 사용하는 방법','CDN Options'=>'CDN 옵션','Cookies which, if present, will prevent caching (one per line)'=>'존재하는 경우 캐싱을 방지하는 쿠키(한 줄에 하나씩)','e.g.: /js/main.js'=>'예: /js/main.js','e.g.: /wp-content/themes/my-theme/css/custom-font.css'=>'예: /wp-content/themes/my-theme/css/custom-font.css','e.g.: example.com'=>'예: example.com','Examples: https://fonts.googleapis.com, https://fonts.gstatic.com'=>'예: https://fonts.googleapis.com, https://fonts.gstatic.com','External URLs to merge'=>'병합할 외부 URL','Force HTTP'=>'강제 HTTP','Force HTTPS'=>'강제 HTTPS','Force the CDN Usage'=>'CDN 사용 강제','However, you can define a CDN Domain below, in order to use it for all of the static assets "inside" your CSS and JS files.'=>'그러나 CSS 및 JS 파일 "내부"의 모든 정적 자산에 사용하기 위해 아래에서 CDN 도메인을 정의할 수 있습니다.','HTML, JavaScript and CSS will be loaded normally by WordPress.'=>'HTML, JavaScript 및 CSS는 워드프레스에서 정상적으로 로드됩니다.','I know what I\'m doing...'=>'내가 뭘하는지 알아...','If you do not have SSL'=>'SSL이 없는 경우','If you force this, your JS files may not load for certain slow internet users on Google Chrome.'=>'이를 강제로 적용하면 구글 크롬에서 특정 느린 인터넷 사용자에게 JS 파일이 로드되지 않을 수 있습니다.','In the settings, caching is disabled for the front page'=>'설정에서 첫 페이지에 대한 캐싱이 비활성화되어 있습니다.','List of browser agent strings which, if detected, will prevent caching'=>'감지될 경우 캐싱을 방지하는 브라우저 에이전트 문자열 목록','List of external domains that can be fetched and merged:'=>'가져오고 병합할 수 있는 외부 도메인 목록:','Load my JS files from the CDN, even when "defer for Pagespeed Insights" is enabled'=>'"Pagespeed Insights 연기"가 활성화된 경우에도 CDN에서 내 JS 파일 로드','Loading data...'=>'데이터 로드 중...','Loading tables list...'=>'테이블 목록 로드 중...','Miscellaneous'=>'기타','N/A'=>'해당 없음','Preconnect Headers'=>'사전 연결 헤더','Preconnect'=>'사전 연결','Recommended if you have SSL'=>'SSL이 있는 경우 권장','Refresh data'=>'데이터 새로 고침','Refreshing the page to reflect changes...'=>'변경 사항을 반영하도록 페이지를 새로 고치는 중...','Remove default WordPress and TinyMCE icons'=>'기본 워드프레스 및 TinyMCE 아이콘 제거','Remove meta information from page header'=>'페이지 헤더에서 메타 정보 제거','Remove resource hints, generator tag, shortlinks, manifest link, etc.'=>'리소스 힌트, 생성기 태그, 단축 링크, 매니페스트 링크 등을 제거합니다.','SSL options'=>'SSL 옵션','The command "%s" was not found'=>'"%s" 명령을 찾을 수 없습니다.','The file advanced-cache.php needs to be updated, but the automatic process failed.'=>'파일 advanced-cache.php를 업데이트해야 하지만 자동 프로세스가 실패했습니다.','The security check failed; try refreshing the page.'=>'보안 검사에 실패했습니다. 페이지를 새로고침해 보세요.','Use only the strictly minimum necessary domain names, (CDN or frequent embeds):'=>'최소한의 필수 도메인 이름(CDN 또는 빈번한 임베드)만 사용하십시오.','Use the complete scheme (http:// or https://) followed by the domain name only (no file paths).'=>'완전한 스키마(http:// 또는 https://) 다음에 도메인 이름만(파일 경로 없음)을 사용하십시오.','Useful for debugging or to improve compatibility with some visual editors.'=>'디버깅에 유용하거나 일부 시각적 편집기와의 호환성을 개선하는 데 유용합니다.','When selected, the site will use the device\'s built in Emoji'=>'선택하면 사이트에서 기기에 내장된 이모티콘을 사용합니다.','When the "Enable defer on processed JavaScript files" option is enabled, JavaScript and CSS files will not be loaded from the CDN due to %scompatibility%s reasons.'=>'"처리된 JavaScript 파일에 대한 지연 활성화" 옵션이 활성화되면 %scompatibility%s 이유로 인해 JavaScript 및 CSS 파일이 CDN에서 로드되지 않습니다.','You are not allowed to run this command.'=>'이 명령을 실행할 권한이 없습니다.','You may need it for some CDN plugins to work:'=>'일부 CDN 플러그인이 작동하려면 필요할 수 있습니다.','Your CDN domain'=>'CDN 도메인','WP-Optimize Minify requires a higher PHP version'=>'WP-옵티마이즈 축소에는 더 높은 PHP 버전이 필요합니다.','Force HTTP or HTTPS on the assets generated by WP-Optimize Minify.'=>'WP-옵티마이즈 축소에서 생성된 자산에 HTTP 또는 HTTPS를 강제 적용합니다.','Add any external "domain" for JavaScript or CSS files that can be fetched and merged by WP-Optimize, e.g.: cdnjs.cloudflare.com'=>'WP-옵티마이즈에서 가져오고 병합할 수 있는 JavaScript 또는 CSS 파일에 대한 외부 "도메인"을 추가합니다(예: cdnjs.cloudflare.com).','Disable Minify for logged-in users'=>'로그인한 사용자에 대해 최소화 비활성','The minification cache was deleted.'=>'최소화 캐시가 삭제되었습니다.','CSS files'=>'CSS 파일','CSS, JavaScript and HTML minification is an advanced feature.'=>'CSS, JavaScript 및 HTML 축소는 고급 기능입니다.','Current cache path:'=>'현재 캐시 경로:','Default exclusions'=>'기본 제외','Do not edit this if you are not sure what it is.'=>'그것이 무엇인지 확실하지 않으면 이것을 편집하지 마십시오.','e.g.: /bootstrap.css'=>'예: /bootstrap.css','e.g.: /wp-includes/js/jquery/jquery.js'=>'예: /wp-includes/js/jquery/jquery.js','Edit default exclusions'=>'기본 제외 수정','Enable debug mode'=>'디버그 모드 사용','Enable this option to see or edit those files.'=>'해당 파일을 보거나 편집하려면 이 옵션을 활성화합니다.','Files that have been consistently reported by other users to cause trouble when merged'=>'병합 시 문제가 발생한다고 다른 사용자가 지속적으로 보고한 파일','HTTP Headers'=>'HTTP 헤더','IE incompatible files'=>'IE 호환되지 않는 파일','If you are using an unsupported cache plugin, then you will also need to purge your page cache when doing this.'=>'지원되지 않는 캐시 플러그인을 사용하는 경우 이 작업을 수행할 때 페이지 캐시도 제거해야 합니다.','Increment cache'=>'증분 캐시','JavaScript files'=>'자바스크립트 파일','Known incompatible files'=>'알려진 호환되지 않는 파일','List of processed files'=>'처리된 파일 목록','none'=>'없음','PHP version requirement (5.4 minimum) not met'=>'PHP 버전 요구 사항(최소 5.4)이 충족되지 않음','Preconnect Headers: This will add link headers to your HTTP response to instruct the browser to preconnect to other domains (e.g.: fonts, images, videos, etc)'=>'사전 연결 헤더: HTTP 응답에 링크 헤더를 추가하여 브라우저가 다른 도메인(예: 글꼴, 이미지, 비디오 등)에 사전 연결하도록 지시합니다.','Preload Headers: Use this for preloading specific, high priority resources that exist across all of your pages.'=>'헤더 미리 로드: 모든 페이지에 존재하는 우선 순위가 높은 특정 리소스를 미리 로드하는 데 사용합니다.','Show information'=>'정보 표시','The PHP version on your server is too old.'=>'서버의 PHP 버전이 너무 오래되었습니다.','There are no merged CSS files listed here, because you are inlining all CSS directly'=>'모든 CSS를 직접 인라인하기 때문에 여기에 나열된 병합된 CSS 파일이 없습니다.','This will also purge the page cache'=>'이렇게 하면 페이지 캐시도 제거됩니다.','Update PHP to enable minification of JS, CSS and HTML on this website'=>'이 웹 사이트에서 JS, CSS 및 HTML을 축소할 수 있도록 PHP를 업데이트하십시오.','"it" refers to the Minify feature.We will do our best to help you configure it.'=>'구성할 수 있도록 최선을 다하겠습니다.','"it" refers to the Minify feature.If you encounter an issue and are not sure what to do, disable the feature and ask for help on the support forum.'=>'문제가 발생하고 어떻게 해야 할지 잘 모르겠으면 기능을 비활성화하고 지원 포럼에서 도움을 요청하십시오.','"it" refers to the Minify feature.While enabling it will work just fine for most sites, it might need specific configuration to work properly on your website.'=>'활성화하면 대부분의 사이트에서 잘 작동하지만 웹 사이트에서 제대로 작동하려면 특정 구성이 필요할 수 있습니다.','Enable WP-O Minify CSS files preloading'=>'WP-옵티마이즈 축소 CSS 파일 미리 로드 활성화','Enable WP-O Minify JavaScript files Preload'=>'WP-옵티마이즈 축소 JavaScript 파일 사용 사전 로드','Automatically create HTTP headers for WP-O Minify-generated JS files'=>'WP-옵티마이즈 축소에서 생성된 JS 파일용 HTTP 헤더 자동 생성','Automatically create HTTP headers for WP-O Minify-generated CSS files (when not inlined)'=>'WP-옵티마이즈 축소에서 생성된 CSS 파일에 대한 HTTP 헤더 자동 생성(인라인되지 않은 경우)','By default, WP-Optimize excludes a list of files that are known to cause problems when minified or combined.'=>'기본적으로 WP-옵티마이즈는 축소하거나 결합할 때 문제를 일으키는 것으로 알려진 파일 목록을 제외합니다.','Enable Minify'=>'최소화 활성','Minify cache size:'=>'최소화 캐시 크기 :','Minify cache information'=>'최소화 캐시 정보','Last Minify cache update:'=>'마지막 최소화 캐시 업데이트:','All caches from %s have also been purged.'=>'%s의 모든 캐시도 제거되었습니다.','All URLs were preloaded into cache successfully'=>'모든 URL이 성공적으로 캐시에 미리 로드되었습니다.','Any CSS files that match the paths below will be completely ignored.'=>'아래 경로와 일치하는 모든 CSS 파일은 완전히 무시됩니다.','Any CSS files that match the paths below will be loaded asynchronously.'=>'아래 경로와 일치하는 모든 CSS 파일은 비동기식으로 로드됩니다.','Any file present here will be loaded normally by WordPress'=>'여기에 있는 모든 파일은 워드프레스에서 정상적으로 로드됩니다.','Any JavaScript files that match the paths below will be completely ignored'=>'아래 경로와 일치하는 모든 JavaScript 파일은 완전히 무시됩니다.','Any JavaScript files that match the paths below will be loaded asynchronously.'=>'아래 경로와 일치하는 모든 JavaScript 파일은 비동기식으로 로드됩니다.','Asynchronously load CSS files from Google Fonts'=>'구글 폰트에서 CSS 파일을 비동기식으로 로드','Asynchronously load fonts from Google Fonts using JavaScript'=>'JavaScript를 사용하여 구글 폰트에서 비동기식으로 글꼴 로드','Asynchronously load the Font Awesome CSS file'=>'Font Awesome CSS 파일을 비동기식으로 로드','Asynchronously load the Font Awesome stylesheet using JavaScript'=>'JavaScript를 사용하여 Font Awesome 스타일시트를 비동기식으로 로드','Caching is disabled'=>'캐싱이 비활성화됨','Caching is enabled'=>'캐싱이 활성화됨','Choose how to include Font Awesome (only available if it has \'font-awesome\' in the url):'=>'Font Awesome 포함 방법 선택(URL에 \'font-awesome\'이 있는 경우에만 사용 가능):','Choose how to include fonts from Google Fonts on your pages, when available:'=>'가능한 경우 페이지에 구글 글꼴의 글꼴을 포함하는 방법을 선택합니다.','Critical path CSS'=>'중요 경로 CSS','CSS options'=>'CSS 옵션','Current cache size: %s'=>'현재 캐시 크기: %s','Dequeue all CSS files'=>'모든 CSS 파일을 대기열에서 빼기','e.g. You may want to exclude \'fontawesome\' or other libraries from the initial load'=>'예: 초기 로드에서 \'fontawesome\' 또는 기타 라이브러리를 제외할 수 있습니다.','Enable asynchronous CSS'=>'비동기 CSS 활성화','Enable if your site does not need specific print styles.'=>'사이트에 특정 인쇄 스타일이 필요하지 않은 경우 활성화하십시오.','Error: %s is not a directory!'=>'오류: %s은(는) 디렉토리가 아닙니다!','Exclude JavaScript from processing'=>'처리에서 JavaScript 제외','Exclude the following CSS files from processing'=>'처리에서 다음 CSS 파일 제외','Fallback CSS'=>'대체 CSS','Font Awesome'=>'멋진 글꼴','Google Fonts'=>'구글 글꼴','If you have multiple css files per media type, they may load out of order and break your design when loaded asynchronously.'=>'미디어 유형당 여러 css 파일이 있는 경우 순서가 맞지 않게 로드될 수 있으며 비동기적으로 로드될 때 디자인이 손상될 수 있습니다.','If you need something more than %s for it to work, then your server is probably misconfigured.'=>'작동을 위해 %s 이상의 것이 필요한 경우 서버가 잘못 구성되었을 수 있습니다.','Inline CSS'=>'인라인 CSS','is_front_page (conditional)'=>'is_front_page(조건부)','JavaScript options'=>'자바스크립트 옵션','Load all CSS files asynchronously'=>'모든 CSS 파일을 비동기식으로 로드','Load the following CSS files asynchronously'=>'다음 CSS 파일을 비동기식으로 로드','Merge fonts from Google Fonts into one request'=>'구글 폰트의 글꼴을 하나의 요청으로 병합','Never.'=>'절대.','Note that inline CSS won\'t work if this is active'=>'인라인 CSS가 활성화되어 있으면 작동하지 않습니다.','Number of files: %s'=>'파일 수: %s','Page cache purged successfully'=>'페이지 캐시가 성공적으로 제거되었습니다.','Page cache settings updated successfully.'=>'페이지 캐시 설정이 성공적으로 업데이트되었습니다.','Please contact your hosting provider.'=>'호스팅 제공업체에 문의하세요.','Preloading is currently running in another process.'=>'사전 로드가 현재 다른 프로세스에서 실행 중입니다.','Preloading URLs into cache...'=>'URL을 캐시에 미리 로드하는 중...','Recommended if the CSS files are small enough.'=>'CSS 파일이 충분히 작은 경우 권장됩니다.','Some files known for causing issues when combined / minified are excluded by default.'=>'결합/축소 시 문제를 일으키는 것으로 알려진 일부 파일은 기본적으로 제외됩니다.','Strip the "print" related stylesheets'=>'"print" 관련 스타일시트 제거','The blog ID provided does not match the current blog.'=>'제공된 블로그 ID가 현재 블로그와 일치하지 않습니다.','The JavaScript files will be combined and minified to lower the number and size of requests.'=>'JavaScript 파일이 결합되고 축소되어 요청의 수와 크기가 줄어듭니다.','The stylesheets will be combined and minified to lower the number and size of requests.'=>'스타일시트가 결합되고 축소되어 요청의 수와 크기가 줄어듭니다.','This improves speed when loading multiple fonts from Google Fonts.'=>'이렇게 하면 구글 폰트에서 여러 글꼴을 로드할 때 속도가 향상됩니다.','This is useful if you want to test your critical path CSS'=>'중요한 경로 CSS를 테스트하려는 경우에 유용합니다.','This will be inlined after the above if your page matches the WP conditional is_front_page()'=>'페이지가 WP 조건부 is_front_page()와 일치하는 경우 위 항목 뒤에 인라인됩니다.','Use if you want to exclude Font Awesome from page speed tests (PageSpeed Insights, GTMetrix...)'=>'페이지 속도 테스트(PageSpeed ​​Insights, GTMetrix...)에서 Font Awesome을 제외하려는 경우에 사용합니다.','Use if you want to exclude the CSS from Google Fonts from performance tests.'=>'성능 테스트에서 구글 Fonts의 CSS를 제외하려는 경우에 사용합니다.','Use this if you are having issues with a certain JavaScript file.'=>'특정 JavaScript 파일에 문제가 있는 경우 이를 사용하십시오.','Use this if you are having issues with a specific CSS file'=>'특정 CSS 파일에 문제가 있는 경우 사용하십시오.','When selected, any CSS files with the media type "print" will be removed.'=>'선택하면 미디어 유형이 "인쇄"인 모든 CSS 파일이 제거됩니다.','Will use \'preload\' with LoadCSS polyfill'=>'LoadCSS 폴리필과 함께 \'사전 로드\'를 사용합니다.','You can see / edit them in the Advanced tab.'=>'고급 탭에서 확인/편집할 수 있습니다.','All caches from WP-Optimize Minify have been purged.'=>'WP-옵티마이즈 축소의 모든 캐시가 제거되었습니다.','WP-Optimize Minify needs write permissions on the folder %s.'=>'WP-옵티마이즈 축소는 %s 폴더에 대한 쓰기 권한이 필요합니다.','The current permissions for WP-Optimize Minify are chmod %s.'=>'WP-옵티마이즈 축소의 현재 권한은 chmod %s입니다.','WP-Optimize Minify requires the PHP mbstring module to be installed on the server; please ask your web hosting company for advice on how to enable it on your server.'=>'WP-옵티마이즈 축소를 사용하려면 서버에 PHP mbstring 모듈을 설치해야 합니다. 서버에서 활성화하는 방법에 대한 조언은 웹 호스팅 회사에 문의하십시오.','Purge minify cache'=>'최소화 캐시 제거','Enable minification of CSS files'=>'CSS 파일 최소화 활성','Enable minification of JavaScript files'=>'JavaScript 파일 최소화 활성','It seems to be handled by Cloudflare.'=>'Cloudflare에서 처리하는 것 같습니다.','This is a REST API request (identified by REST_REQUEST constant)'=>'이것은 REST API 요청입니다(REST_REQUEST 상수로 식별됨).','Your server uses Brotli compression instead of Gzip, which is good.'=>'귀하의 서버는 좋은 Gzip 대신 Brotli 압축을 사용합니다.','Please navigate, via FTP, to the folder - %s'=>'FTP를 통해 폴더 - %s로 이동하세요.','Copy and paste the following lines into the file:'=>'다음 줄을 복사하여 파일에 붙여넣습니다:','Edit or create a file with the name advanced-cache.php'=>'Advanced-cache.php라는 이름의 파일을 편집하거나 생성합니다.','%s compressed images were restored from their backup for the site %s'=>'%s 압축 이미지가 %s 사이트의 백업에서 복원되었습니다.','%s compressed images were restored from their backup'=>'%s 압축 이미지가 백업에서 복원되었습니다.','All the compressed images for the site %s were successfully marked as uncompressed.'=>'사이트 %s의 모든 압축 이미지가 압축되지 않은 것으로 성공적으로 표시되었습니다.','All the compressed images were successfully marked as uncompressed.'=>'모든 압축된 이미지가 압축되지 않은 것으로 성공적으로 표시되었습니다.','All the compressed images were successfully restored.'=>'모든 압축 이미지가 성공적으로 복원되었습니다.','Comments are opened and the visitor saved his information.'=>'댓글이 열리고 방문자가 자신의 정보를 저장했습니다.','Do you want to restore the original images from the backup (where they exist?)'=>'백업에서 원본 이미지를 복원하시겠습니까(존재하는 위치)?','Mark all images as uncompressed'=>'모든 이미지를 압축되지 않은 것으로 표시','Please check your folder\'s permissions'=>'폴더 권한을 확인하세요.','The backup file %s could not be deleted.'=>'백업 파일 %s을(를) 삭제할 수 없습니다.','The backup was not found; it may have been deleted or was already restored'=>'백업을 찾을 수 없습니다. 삭제되었거나 이미 복원되었을 수 있습니다.','The destination could not be written to.'=>'대상을 쓸 수 없습니다.','The file could not be copied; check your PHP error logs for details'=>'파일을 복사할 수 없습니다. 자세한 내용은 PHP 오류 로그를 확인하십시오.','The image was restored successfully'=>'이미지가 성공적으로 복원되었습니다.','The selected image was successfully marked as compressed'=>'선택한 이미지가 성공적으로 압축된 것으로 표시되었습니다.','The selected image was successfully marked as uncompressed'=>'선택한 이미지가 압축되지 않은 것으로 성공적으로 표시되었습니다.','The file was compressed to %s using WP-Optimize'=>'파일이 WP-옵티마이즈를 사용하여 %s로 압축되었습니다.','Gzip compression is already enabled.'=>'Gzip 압축이 이미 활성화되어 있습니다.','The page cache was not purged.'=>'페이지 캐시가 제거되지 않았습니다.','Automatically delete image backups after'=>'이후 이미지 백업 자동 삭제','days'=>'일','Delete all backup images now'=>'지금 모든 백업 이미지 삭제','Mark as already compressed'=>'이미 압축된 것으로 표시','Mark as uncompressed'=>'압축되지 않은 것으로 표시','More options'=>'추가 옵션','Only delete a table if you are sure of what you are doing, and after taking a backup.'=>'수행 중인 작업이 확실하고 백업을 수행한 후에만 테이블을 삭제하십시오.','or'=>'또는','Please select the images you want to mark as already compressed from the "Uncompressed images" panel first'=>'먼저 "압축되지 않은 이미지" 패널에서 이미 압축된 것으로 표시할 이미지를 선택하십시오.','Please wait: updating information about the selected image.'=>'기다려 주십시오: 선택한 이미지에 대한 정보를 업데이트 중입니다.','The page cache was successfully purged.'=>'페이지 캐시가 성공적으로 제거되었습니다.','This image is marked as already compressed by another tool.'=>'이 이미지는 다른 도구에 의해 이미 압축된 것으로 표시됩니다.','WARNING - some plugins might not be detected as installed or activated if they are in unknown folders (for example premium plugins).'=>'경고 - 일부 플러그인은 알 수 없는 폴더(예: 프리미엄 플러그인)에 있는 경우 설치되거나 활성화된 것으로 감지되지 않을 수 있습니다.','Attempt to create subfolder within cache directory failed'=>'캐시 디렉토리 내에 하위 폴더를 생성하려는 시도가 실패했습니다.','However, the test file we fetched was not Gzip-compressed.'=>'그러나 가져온 테스트 파일은 Gzip으로 압축되지 않았습니다.','It seems one of Apache modules - mod_filter or mod_deflate - is not active.'=>'아파치 모듈(mod_filter 또는 mod_deflate) 중 하나가 활성화되지 않은 것 같습니다.','Output is too small (less than %d bytes) to be worth caching'=>'출력이 너무 작아서(%d바이트 미만) 캐싱할 가치가 없습니다.','Page type is not cacheable (search, 404 or password-protected)'=>'페이지 유형은 캐시할 수 없습니다(검색, 404 또는 비밀번호로 보호됨).','Possible causes include that Apache (your webserver) is not configured to allow .htaccess files to take effect, or one of Apache modules - mod_filter or mod_deflate - is not active, or the webserver is configured to disallow Gzip compression.'=>'가능한 원인으로는 아파치(귀하의 웹 서버)가 .htaccess 파일이 적용되도록 구성되지 않았거나 아파치 모듈(mod_filter 또는 mod_deflate) 중 하나가 활성화되지 않았거나 웹 서버가 Gzip 압축을 허용하지 않도록 구성되어 있기 때문입니다.','User is logged in'=>'사용자가 로그인했습니다.','We successfully added Gzip compression settings into .htaccess file.'=>'Gzip 압축 설정을 .htaccess 파일에 성공적으로 추가했습니다.','You should speak to your web hosting support to find how to enable it.'=>'활성화 방법을 알아보려면 웹 호스팅 지원팀에 문의해야 합니다.','WP-O cache directory was not found'=>'WP-옵티마이즈 캐시 디렉토리를 찾을 수 없습니다.','WP-O cache parent directory was not found'=>'WP-옵티마이즈 캐시 상위 디렉토리를 찾을 수 없습니다.','Advanced settings'=>'고급 설정','Browser static file caching settings (via headers)'=>'브라우저 정적 파일 캐싱 설정(헤더를 통해)','But first, we strongly recommend you backup your site with %sUpdraftPlus%s.'=>'그러나 먼저 %sUpdraftPlus%s로 사이트를 백업하는 것이 좋습니다.','Cache supports WPML multilingual plugin and multiple currencies for WooCommerce'=>'캐시는 WooCommerce용 WPML 다국어 플러그인 및 여러 통화를 지원합니다.','Cache video preview'=>'캐시 비디오 미리보기','Cache your page and post for even more speed.'=>'더 빠른 속도를 위해 페이지와 게시물을 캐시하세요.','Caching'=>'캐싱','Check status again'=>'상태를 다시 확인','Clears out unnecessary data, cleans up your tables and retrieves space lost to data fragmentation.'=>'불필요한 데이터를 지우고 테이블을 정리하며 데이터 조각화로 인해 손실된 공간을 검색합니다.','Compress image'=>'이미지 압축','Compress your images for a much faster page load.'=>'훨씬 빠른 페이지 로드를 위해 이미지를 압축합니다.','Creating tasks for preload site urls.'=>'사이트 URL을 미리 로드하기 위한 작업 만들기.','Current cache size:'=>'현재 캐시 크기:','Database cleaning'=>'데이터베이스 청소','Feedback'=>'피드백','Finally, please take a look at our %spremium version%s, which is packed full of additional speed enhancements to make your site go even faster!'=>'마지막으로, 귀하의 사이트를 더욱 빠르게 만들 수 있는 추가 속도 향상 기능이 포함된 %s프리미엄 버전%s을(를) 살펴보십시오!','Gzip compression settings'=>'Gzip 압축 설정','How to use the cache feature'=>'캐시 기능을 사용하는 방법','How to use the image compression feature'=>'이미지 압축 기능을 사용하는 방법','I need help / something is not working'=>'도움이 필요합니다/뭔가 작동하지 않습니다','If you are unsure what settings to use, please take a look at the %sdocumentation%s.'=>'어떤 설정을 사용해야 할지 확실하지 않은 경우 %s문서%s를 참조하십시오.','Image compression'=>'이미지 압축','Last preload finished at %s'=>'마지막 사전 로드가 %s에 완료되었습니다.','Loading URLs...'=>'URL 로드 중...','Make your site fast & efficient'=>'빠르고 효율적인 사이트 만들기','Multilingual and multi-currency compatible'=>'다국어 및 다중 통화 호환','Not sure how to use the cache feature?'=>'캐시 기능을 사용하는 방법을 모르십니까?','Not sure how to use the image compression feature?'=>'이미지 압축 기능을 사용하는 방법을 모르십니까?','Number of files:'=>'파일 수:','Open the video in a new window'=>'새 창에서 비디오 열기','Options can only be saved by network admin'=>'옵션은 네트워크 관리자만 저장할 수 있습니다.','Page cache is disabled.'=>'페이지 캐시가 비활성화되었습니다.','Page cache'=>'페이지 캐시','Preload'=>'사전 로드','Premium Upgrade'=>'프리미엄 업그레이드','Press this to see if any changes were made to your Gzip configuration'=>'Gzip 구성이 변경되었는지 확인하려면 이 버튼을 누르세요.','Read the documentation'=>'문서 읽기','Same as cache lifespan'=>'캐시 수명과 동일','Started preload...'=>'프리로드를 시작했습니다...','Static file headers'=>'정적 파일 헤더','Tasks for preload site urls created.'=>'미리 로드 사이트 URL에 대한 작업이 생성되었습니다.','Time after which a new cached version will be generated (0 = only when the cache is emptied)'=>'새 캐시된 버전이 생성되기까지의 시간(0 = 캐시가 비워진 경우에만)','Watch our how-to video below.'=>'아래 방법 동영상을 시청하세요.','Watch our howto video below.'=>'아래의 하우투 동영상을 시청하세요.','We could not determine if Gzip compression is enabled.'=>'Gzip 압축이 활성화되어 있는지 확인할 수 없습니다.','Loads a video hosted on vimeo.com'=>'Vimeo.com에 호스팅된 비디오를 로드합니다.','%d url found.'=>'%d개의 URL을 찾았습니다.','%1$s out of %2$s URL preloaded'=>'%2$s URL 중 %1$s 미리 로드됨','%s is replaced by a link tagPS - check out our new improved Premium version %shere%s.'=>'추신 - 새롭게 개선된 프리미엄 버전 %s여기%s를 확인하십시오.','%s will be replaced by a "strong" tagThe plugin settings are split into three parts: %sclean%s the database, %scompress%s images and %scaching%s.'=>'플러그인 설정은 %sclean%s 데이터베이스, %scompress%s 이미지 및 %scaching%s의 세 부분으로 나뉩니다.','Thank you for updating WP-Optimize!'=>'WP-옵티마이즈를 업데이트해주셔서 감사합니다!','WP-Optimize - Clean, Compress, Cache'=>'WP-옵티마이즈 - 정리, 압축, 캐시','I have an idea to improve WP-Optimize'=>'WP-옵티마이즈를 개선할 아이디어가 있습니다.','The team at WP-Optimize is working hard to make your site fast and efficient.'=>'WP-옵티마이즈 팀은 귀하의 사이트를 빠르고 효율적으로 만들기 위해 열심히 노력하고 있습니다.','%sRead the full WP-Optimize documentation%s, or if you have any questions, please ask %sPremium support%s'=>'%s전체 WP-옵티마이즈 문서%s를 읽거나 질문이 있는 경우 %s프리미엄 지원%s에 문의하십시오.','If you already have plugins for minifying, don\'t worry - WP-Optimize won\'t interfere unless you turn these options on.'=>'축소를 위한 플러그인이 이미 있는 경우 걱정하지 마십시오. 이러한 옵션을 설정하지 않으면 WP-옵티마이즈가 간섭하지 않습니다.','WP-Optimize can trigger UpdraftPlus to automatically back up right before any optimization takes place, so you can undo any changes you make.'=>'WP-옵티마이즈는 최적화가 수행되기 직전에 UpdraftPlus가 자동으로 백업하도록 트리거할 수 있으므로 변경 사항을 취소할 수 있습니다.','This action will trigger WP-Optimize to cache the site by visiting pages to preload them (so that they are ready the first time a human visitor wants them).'=>'이 조치는 WP-옵티마이즈가 페이지를 방문하여 사이트를 미리 로드하여 사이트를 캐시하도록 트리거합니다(그래서 방문자가 처음 원할 때 사이트가 준비되도록 합니다).','Activate scheduled cache preloading'=>'예약된 캐시 미리 로드 활성화','Cache lifespan'=>'캐시 수명','Cache settings'=>'캐시 설정','Compression options'=>'압축 옵션','Days'=>'일','Deletes the entire cache contents but keeps the page cache enabled.'=>'전체 캐시 내용을 삭제하지만 페이지 캐시는 활성화된 상태로 유지합니다.','Empty or 0 values disable the headers.'=>'비어 있거나 0 값은 헤더를 비활성화합니다.','Enable page caching'=>'페이지 캐싱 활성화','Enable this option if you do not have user-specific or restricted content on your website.'=>'웹 사이트에 사용자별 또는 제한된 콘텐츠가 없는 경우 이 옵션을 활성화하십시오.','Generate separate files for mobile devices'=>'모바일 장치용으로 별도의 파일 생성','Hide advanced options'=>'고급 옵션 숨기기','Hours'=>'시간','If a sitemap is available, then it will be used to determine which content gets cached.'=>'사이트맵을 사용할 수 있는 경우 캐시할 콘텐츠를 결정하는 데 사용됩니다.','If any of the above strings is found in the User-Agent HTTP header, then the requested page will not be cached.'=>'User-Agent HTTP 헤더에서 위 문자열 중 하나라도 발견되면 요청된 페이지가 캐시되지 않습니다.','Lazy-load'=>'지연 로드','List of browser agents strings or substrings that should not be served cached files (one per line)'=>'캐시된 파일을 제공하지